import React from "react";
import CardList from "../components/CardList";

function Cards() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        margin: "0 20px",
      }}
    >
      <h1
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        Trading Cards
      </h1>
      <CardList />
    </div>
  );
}

export default Cards;
